      <div className="d-flex align-items-center">
        <span className="text-muted fs-4 fw-bold">© 2024 GoFood, Inc</span>
        <span className="mx-4 text-muted fs-4 fw-bold">Made with ❤️ by Shreeraksha</span>
      </div>
    </footer>
  );
}
